import * as Yup from "yup";
export const SignupSchema = Yup.object({
  name: Yup.string().min(2).max(25).required("Please enter your name"),
  email: Yup.string().email().required("Please enter your Email"),
  mobile: Yup.number().typeError("That doesn't look like a phone number").positive("A phone number can't start with a minus").integer("A phone number can't include a decimal point").min(8).required('A phone number is required'),
  confirm_password: Yup.string().required("Please enter your confirm password").oneOf([Yup.ref("password"), null, "Password must match"])
});
